import React from 'react';

class App extends React.Component{
  state={
    //바꿀 데이터는 state 안에 넣기
    isLoading:true
  };

  rener(){
    const {isLoading} = this.state;
    return <div>{isLoading ? "Loading.." : "we are ready"}</div>;
  }
};

export default App;
